var title_f21_39_22139="Criteria narcissistic personal";
var content_f21_39_22139=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F63552&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F63552&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for narcissistic personality disorder",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Five or more of following plus general criteria for personality disorder:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Has a grandiose sense of self-importance",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Is preoccupied with fantasies of unlimited success, power, brilliance, beauty, or ideal love",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Believes he or she is \"special\" and unique and can only be understood by or should associate with other special or high-status people (or institutions)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4. Requires excessive admiration",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       5. Has a sense of entitlement",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       6. Is interpersonally exploitative, ie, takes advantage of others to achieve his or her own ends",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       7. Lacks empathy: unwilling to recognize or identify with the feelings and needs of others",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       8. Is often envious of others or believes that others are envious of him or her",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       9. Shows arrogant, haughty behaviors or attitudes",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from American Psychiatric Association. Diagnostic and Statistical Manual of Mental Disorders, 4th ed, Text revision (DSM-IV-TR). American Psychiatric Association, Washington, DC, 2000.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
