var title_f21_39_22140="Risk of thromboembolism in AF";
var content_f21_39_22140=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F81802&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F81802&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Risk of systemic thromboembolism in nonvalvular atrial fibrillation from the SPAF-III trial in patients treated with aspirin",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Risk category",
"       </td>",
"       <td class=\"subtitle1\">",
"        Thromboembolic risk, percent per year",
"       </td>",
"       <td class=\"subtitle1\">",
"        NNT*",
"       </td>",
"       <td class=\"subtitle1\">",
"        General recommendations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Prior stroke or TIA",
"       </td>",
"       <td>",
"        10",
"       </td>",
"       <td>",
"        14",
"       </td>",
"       <td>",
"        Warfarin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"4\">",
"        Primary prevention",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        High",
"       </td>",
"       <td class=\"sublist_other\">",
"        6",
"       </td>",
"       <td class=\"sublist_other\">",
"        33",
"       </td>",
"       <td class=\"sublist_other\">",
"        Warfarin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Moderate",
"       </td>",
"       <td class=\"sublist_other\">",
"        3",
"       </td>",
"       <td class=\"sublist_other\">",
"        66",
"       </td>",
"       <td class=\"sublist_other\">",
"        Warfarin or aspirn",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Low",
"       </td>",
"       <td class=\"sublist_other\">",
"        1",
"       </td>",
"       <td class=\"sublist_other\">",
"        200",
"       </td>",
"       <td class=\"sublist_other\">",
"        Aspirin",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"4\">",
"        Definitions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"4\">",
"        <strong>",
"         High",
"        </strong>",
"        - one or more of the following",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"4\">",
"        Previous thromboembolism",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"4\">",
"        Woman older than 75 years of age",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"4\">",
"        Systolic pressure &gt;160 mm Hg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\" colspan=\"4\">",
"        Heart failure or severe left ventricular dysfunction",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         Moderate",
"        </strong>",
"        - none of the above but a history of hypertension",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"4\">",
"        <strong>",
"         Low",
"        </strong>",
"        - none of the above",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * NNT: number needed to treat with warfarin rather than aspirin for one year to prevent one event.",
"    </div>",
"    <div class=\"reference\">",
"     Adapated from Stroke Prevention in Atrial Fibrillation III randomised clinical trial. Lancet 1996; 348:633; and The SPAF III Writing Committee for the Stroke Prevention in Atrial Fibrillation Investigators. JAMA 1998; 279:1273.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
