var title_f21_39_22142="Lipid lowering improves outcome after CABG";
var content_f21_39_22142=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F74401&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F74401&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 529px\">",
"   <div class=\"ttl\">",
"    Aggressive lipid lowering improves the outcome after CABG",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 509px; height: 349px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    In the Post Coronary Artery Bypass Graft trial, which enrolled 1351 patients, aggressive lipid lowering therapy with lovastatin and, if needed, cholestyramine insignificantly reduced the composite clinical end point of death, myocardial infarction, need for revascularization procedures, or stroke by 18 percent at the end of the trial. However, at the end of the 7.5 year extended follow-up period, there was a significant 24 percent reduction in the composite clinical endpoint (p = 0.001).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Knatterud GL, Rosenberg Y, Campeau L, et al. Circulation 2000; 102:157.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
